import React from 'react';

interface RadioTamanhoProps {
  register: any;
  tamanhos: string[];
}

const RadioTamanho: React.FC<RadioTamanhoProps> = ({ register, tamanhos }) => {
  return (
    <div id='tamanhos' className="itens">
      {tamanhos.map((tamanho, index) => (
        <div key={index} id={`tamanho_${tamanho.toLowerCase()}`}>
          <label>{tamanho}</label>
          <input {...register("tamanho")} type="radio" value={tamanho} />
        </div>
      ))}
    </div>
  );
};

export default RadioTamanho;
